        X1 = 1.0,
        Y1 = 1.0,
        Z1 = 1.0,
        D = 0.1d,
        Boxed = false,
        IneqTree = 
          (# -pow(sqrt(x * x + y * y) - 0.90, 2)  - z * z + 0.0515) &
          (# x*x+y*y+z*z-1)
      };
}
